import React from 'react';

import TubeDBLogo from '../images/logo4.png';

import { HomeOutlined, PlaySquareOutlined, VideoCameraAddOutlined } from '@ant-design/icons';
import { Menu } from 'antd';
import Icon from '@ant-design/icons';

class HeaderMenu extends React.Component {
  state = {
    current: 'home',
  };

  handleClick = e => {
    console.log('click ', e);
    this.setState({
      current: e.key,
    });
  };

  render() {
    return (
      <Menu onClick={this.handleClick} selectedKeys={[this.state.current]} mode="horizontal">
        <Menu.Item key="home">
          <Icon type="home" />
          Home
        </Menu.Item>
        <Menu.Item key="videos">
          <Icon type="play-square" />
          Trending Videos
        </Menu.Item>
        <Menu.Item key="channels">
        <Icon type="video-camera" />
          <a href="https://homepage" target="_blank" rel="noopener noreferrer">
            Channels
          </a>
        </Menu.Item>
      </Menu>
    );
  }
}

export default HeaderMenu;
